import React from 'react';

class City extends React.Component {
    constructor(props) {
        super(props);
        this.state = { name: props.name, src: props.src };
        document.getElementById("city").style.backgroundColor = "https://i.ibb.co/KjrSCJG/buenos-aires.jpg";
    }

    render() {
        return (
            <div className="city">
                <p> {this.props.name} </p>
            </div>
        );
    }
}

export default City;
